def Check_for_updates(window, component, button):
    global is_download
    try:
        url = "https://www.waadri.top/ChaoXing/api/logsapi.php"
        try:
            res = requests.get(url, headers=browser_headers)
            res = json.loads(res.text)
        except:
            messagebox.showwarning("", "", parent=window)
            for c in component:
                c.configure(state="normal")
            return
        version = res["newversion"]
        if version != Version:
            for k in res["data"][0]:
                answer = messagebox.askyesno("", "\n\n" + res["data"][0][k].replace("|", "\n"), parent=window)
                if answer:
                    is_download = 1
                    if button is not None:
                        button.configure(text="")
                    thread_it(Download_the_update, button, window, version, component)
                elif component:
                    for c in component:
                        c.configure(state="normal")
        else:
            if component:
                messagebox.showinfo("", "", parent=window)
                for c in component:
                    c.configure(state="normal")
    except Exception as err:
        Error_handling(sys.exc_info(), err)


